sys_variable_value.value:
(function execute(inputs, outputs) {
  	var ws1tenantcode = "oauth";
  	var ws1tenantname = "aw-snow";

    http_table = new GlideRecord('http_connection');
    http_table.addQuery('name', "Workspace ONE UEM ITSM Basic Credentials");
    http_table.query();
    if (http_table.next()) {
        if (http_table.active) {
          	var rec = new GlideRecord('x_vmw_ws1uem_ws1uemappconfig');
			rec.addQuery('name', "WS1UEMTenantCode");
			rec.query();
			if(rec.next()){
          		ws1tenantcode = rec.value;
         	 	ws1tenantname = "aw-tenant-code";
			}
        }
    } 

  outputs.ws1tenantcode = ws1tenantcode;
  outputs.ws1tenantname = ws1tenantname;

})(inputs, outputs);

